  <div>
     <Header type = {"UX Designer and Web Developer"} title = {"Eamonn Burke"} desc = {"View Resume"}/>
     <div className = "page-content">
      <Popular />
      <Discography />
      {/* <Featuring /> */}
      {/* <Skills /> */}
     </div>
     <About />
  </div>
    );

}
